	add("stomachache", "{\"term\":\"stomachache\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A pain in the abdomen, often caused by indigestion. (The pain is usually lower than the stomach and related to the intestines\", \"priority\":1}]}, \"synonyms\":{}}");

	add("stomacher", "{\"term\":\"stomacher\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"Apparently from {{suffix|stomach|er|lang\u003den}}, perhaps after Middle french (ca. 1400-1600) \u0027estomachier\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A type of men\u0027s waistcoat\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An ornamental cloth, often embellished with embroidery or jewelry, worn by women under the lacing of a bodice (over the stomach or chest\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1611\u0027\u0027, \u0027The Bible\u0027, Authorized (King James) Version, Isaiah 3.24\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"And it shall come to pass, that instead of sweet smell there shall be stink; and instead of a girdle a rent; and instead of well set hair baldness; and instead of a \u0027\u0027stomacher\u0027\u0027 a girding of sackcloth; and burning instead of beauty\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1851\u0027\u0027, Commissioners for the Exhibition of 1851, \u0027Official descriptive and illustrated catalogue: Volume 2\u0027, [http://books.google.com/books?id\u003d6R8-AAAAcAAJ\u0026amp;pg\u003dPA689\u0026amp;dq\u003dstomacher page 689\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Stomacher\u0027\u0027 brooch of brilliants and fine oriental pearls\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1853\u0027\u0027, \u0027Bleak House\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"She is a fine old lady, handsome, stately, wonderfully neat, and has such a back and such a \u0027\u0027stomacher\u0027\u0027 that if her stays should turn out when she dies to have been a broad old-fashioned family fire-grate, nobody who knows her would have cause to be surprised\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1890\u0027\u0027, \u0027The Picture of Dorian Gray\u0027, ch. XI\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Here, from the fading canvas, smiled Lady Elizabeth Devereux, in her gauze hood, pearl \u0027\u0027stomacher\u0027\u0027, and pink slashed sleeves\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"1964\u0027\u0027, Mona Curran, \u0027Collecting Antique Jewellery\u0027,\u0026lt;sup \u0026gt;[http://books.google.com/books?id\u003dXBo4AQAAIAAJ ]\u0026lt;/sup\u0026gt; Emerson Books, page 76\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"From about 1850 onwards jewellery varied between these outsize sprays, \u0027\u0027stomachers\u0027\u0027 and corsage montages and smaller, more delicate pieces which appeared almost understated by contrast\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Judith Pascoe, \u0027The Hummingbird Cabinet\u0027, Cornell University Press, ISBN 978-0-8014-4362-6, page 58\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"The most striking accessory of all, however, was a diamond \u0027\u0027stomacher\u0027\u0027, a kind of lapidary bib that covered the princess\u0027s chest and stomach. We do not know exactly what Charlotte was thinking as she stood under the weight of silver, ermine, velvet, and jewels. But we know what many who saw her thought about her \u0027\u0027stomacher\", \"priority\":14}]}, \"synonyms\":{}}");

	add("stomachful", "{\"term\":\"stomachful\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|stomach|ful|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Enough to fill one\u0027s stomach\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"As much as one can stomach\", \"priority\":2}]}, \"synonyms\":{}}");

	add("stomatitis", "{\"term\":\"stomatitis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|stomato|itis|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An inflammation of parts of the mucous membrane lining of the mouth\", \"priority\":1}]}, \"synonyms\":{}}");

	add("stomatology", "{\"term\":\"stomatology\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"stomato- + -ology\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The study of the mouth and its disorders and diseases\", \"priority\":1}]}, \"synonyms\":{}}");

	add("stompbox", "{\"term\":\"stompbox\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|stomp|box|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A simple percussion instrument consisting of a small wooden box placed under the foot, which is tapped or stamped on rhythmically to produce a sound similar to that of a bass drum\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A guitar effect unit which can be controlled with the foot\", \"priority\":2}]}, \"synonyms\":{}}");

	add("stonebrash", "{\"term\":\"stonebrash\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|stone|brash|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A subsoil made up of small stones or finely broken rock\", \"priority\":1}]}, \"synonyms\":{}}");

