	add("stonemason", "{\"term\":\"stonemason\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027stone\u0027 and \u0027mason\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"one who works in stone\", \"priority\":1}]}, \"synonyms\":{}}");

	add("stoneware", "{\"term\":\"stoneware\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|stone|ware|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A type of pottery that is fired at a high temperature and is dense, opaque and nonporous\", \"priority\":1}]}, \"synonyms\":{}}");

