	add("stonker", "{\"term\":\"stonker\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Something highly impressive\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Every record he played was a \u0027\u0027stonker\", \"priority\":2}]}, \"synonyms\":{}}");

	add("stook", "{\"term\":\"stook\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle low german\"], \"text\":\"From or cognate with Middle low german \u0027stuke|stūke\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A pile or bundle, especially of straw\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1932\u0027\u0027, \u0027Sunset Song\u0027, Polygon 2006 (\u0027A Scots Quair\u0027), p. 16\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"And on the road home they lay among the \u0027\u0027stooks\u0027\u0027 and maybe Ellison did this and that to make sure of getting her, he was fair desperate for any woman by then\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1958\u0027\u0027, \u0027The Bell\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The wheat, tawny with ripeness, had been cut and stood in tented \u0027\u0027stooks\u0027\u0027 about the fields, while a few ghostly poppies lingered at the edge of the path\", \"priority\":5}]}, \"synonyms\":{}}");

	add("stooge", "{\"term\":\"stooge\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who knowingly allows herself or himself to be used for another\u0027s profit; a dupe\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A straight man\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A secret informant for police\", \"priority\":3}]}, \"synonyms\":{}}");

