	add("stoolie", "{\"term\":\"stoolie\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A stool pigeon\", \"priority\":1}]}, \"synonyms\":{}}");

	add("stooper", "{\"term\":\"stooper\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|stoop|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who stoops\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"One who searches for discarded winning tickets at a racetrack\", \"priority\":2}]}, \"synonyms\":{}}");

	add("stope", "{\"term\":\"stope\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle low german\"], \"text\":\"Apparently related to \u0027step\u0027, but with uncertain phonological development. Perhaps from a German low german word like \u0027stoop\u0027 (step) from Middle low german \u0027stōpe\u0027 (step) More at {{l|en|stoop}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A mining excavation in the form of a terrace of steps\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Thomas Pynchon, \u0027Against the Day\u0027, Vintage 2007, page 318\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The other smell that worked its way into your clothes, your skin, your spirit, believed here to rise by way of long-deserted drifts and \u0027\u0027stopes\u0027\u0027, from the everyday atmosphere of Hell itself\", \"priority\":3}]}, \"synonyms\":{}}");

	add("stopcock", "{\"term\":\"stopcock\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027stop\u0027 + \u0027cock\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A valve, tap or faucet which regulates the flow of liquid or gas through a pipe\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A main shutoff for water to a home from a municipal supply. Usually these valves exist in pairs, on outside the property boundary and one inside the property boundary\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"If you have a burst pipe turn the water off at the \u0027\u0027stopcock\", \"priority\":3}]}, \"synonyms\":{}}");

	add("stoping", "{\"term\":\"stoping\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"In mining, the removal of the desired ore from an underground mine leaving behind an open space known as a stope\", \"priority\":1}]}, \"synonyms\":{}}");

	add("stoponium", "{\"term\":\"stoponium\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|s|toponium|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A hypothetical bound state of a superpartner of the top quark in some supersymmetric theories\", \"priority\":1}]}, \"synonyms\":{}}");

	add("stopper", "{\"term\":\"stopper\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"1792, from English \u0027stop\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Agent noun of stop, someone or something that stops something\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"section\u003dchapter passage\u003d“It just shows you what women are like. A frightful sex, Bertie. There ought to be a law. I hope to live to see the day when women are no longer allowed.” “That would rather put a \u0027\u0027stopper\u0027\u0027 on keeping the human race going, wouldn\u0027t it?” “Well, who wants to keep the human race going?”\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Carole B. Cox, \u0027Empowering Grandparents Raising Grandchildren\u0027 (page 28\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Often, in our conversations we encourage people to talk, or we manage to stop them. This can happen without our even thinking about it. Following is a list of conversation starters and \u0027\u0027stoppers\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A type of knot at the end of a rope, to prevent it from unravelling\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Put a \u0027\u0027stopper\u0027\u0027 in the knot\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A bung or cor\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"We need a \u0027\u0027stopper\u0027\u0027 or the boat will sink\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"goalkeepe\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"He\u0027s the number one \u0027\u0027stopper\u0027\u0027 in the country\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"In the commodity futures market, someone who is long (owns) a futures contract and is demanding delivery because they want to take possession of the deliverable commodity\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Cattle futures: spillover momentum plus evidence of a strong \u0027\u0027stopper\u0027\u0027 (i.e., 96 loads demanded) should kick the opening higher\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A train that calls at all or almost all stations between its origin and destination, including very small ones\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Any of several trees of the genus \u0027Eugenia\u0027, found in Florida and the West Indies\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"the red \u0027\u0027stopper\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"A playspot where water flows back on itself, creating a retentive feature\", \"priority\":16}]}, \"synonyms\":{}}");

	add("stopple", "{\"term\":\"stopple\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Partly from \u0027stop\u0027, partly from \u0027estoppel\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a plug, a stopper\", \"priority\":1}]}, \"synonyms\":{}}");

	add("stopwatch", "{\"term\":\"stopwatch\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|stop|watch|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A timepiece designed to measure the amount of time elapsed from a particular time when activated and when the piece is deactivated\", \"priority\":1}]}, \"synonyms\":{}}");

	add("store", "{\"term\":\"store\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"Middle english (1100-1500) from Old french (842-ca. 1400) from Latin \u0027instaurare\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A place where items may be accumulated or routinely kept\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A supply held in storage\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"By late summer a sufficient \u0027\u0027store\u0027\u0027 of stone had accumulated, and then the building began, under the superintendence of the pigs\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A place where items may be purchased\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"title\u003ds:Twelve Twelve chapter\u003d1|passage\u003dThere was some laughter, and Roddle was left free to expand his ideas on the periodic visits of cowboys to the town. “Mason Rickets, he had ten big punkins a-sittin\u0027 in front of his \u0027\u0027store\u0027\u0027, an\u0027 them fellers from the Upside-down-F ranch shot \u0027em up […].”\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Memory\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A large amount of information retained in one\u0027s memory\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A great quantity or number\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1608-1674\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"With \u0027\u0027store\u0027\u0027 of ladies, whose bright eyes / Rain influence, and give the prize\", \"priority\":10}]}, \"synonyms\":{}}");

	add("storehouse", "{\"term\":\"storehouse\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|store|house|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A building for keeping goods of any kind, especially provisions; a magazine; a repository; a warehouse\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"by extension) A single non-geographical place where a large quantity of something can be found\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"This old book is a genuine \u0027\u0027storehouse\u0027\u0027 of useful cooking tips\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A mass or quantity laid up\", \"priority\":4}]}, \"synonyms\":{}}");

	add("storekeeper", "{\"term\":\"storekeeper\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|store|keeper|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who runs a shop, either the owner or manager\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d5|passage\u003dWhen this conversation was repeated in detail within the hearing of the young woman in question, and undoubtedly for his benefit, Mr. Trevor threw shame to the winds and scandalized the Misses Brewster then and there by proclaiming his father to have been a country \u0027\u0027storekeeper\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"One who is in charge of stores or goods of any kind\", \"priority\":3}]}, \"synonyms\":{}}");

	add("storeman", "{\"term\":\"storeman\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|store|man|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A warehouseman\", \"priority\":1}]}, \"synonyms\":{}}");

	add("storer", "{\"term\":\"storer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a young tree, especially one reserved when others are cut; a standel\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1957\u0027\u0027, H.R. Schubert, \u0027History of the British Iron and Steel Industry\u0027, p. 221\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"It was ordered that twelve standels or \u0027\u0027storers\u0027\u0027 per acre in coppices or underwoods of twenty-four years\u0027 growth or less should be excluded from felling, and twelve \u0027great trees\u0027 on every acre above twenty-four years\u0027 growth\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"One who lays up or forms a store\", \"priority\":4}]}, \"synonyms\":{}}");

	add("storeship", "{\"term\":\"storeship\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|store|ship|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A vessel used to carry naval stores for a fleet, garrison, etc\", \"priority\":1}]}, \"synonyms\":{}}");

	add("storie", "{\"term\":\"storie\", \"etymology\":{\"influencers\":[], \"languages\":[\"friulian\", \"Latin\"], \"text\":\"Borrowed from Latin {{m|la|historia}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"story\", \"priority\":1}]}, \"synonyms\":{}}");

	add("storksbill", "{\"term\":\"storksbill\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|stork|bill|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of various Eurasian erodiums\", \"priority\":1}]}, \"synonyms\":{}}");

	add("stormtrooper", "{\"term\":\"stormtrooper\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\"], \"text\":\"A calque of German \u0027sturmtruppen\u0027 from \u0027sturm\u0027 (storm) + \u0027truppen\u0027 (troops)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A soldier trained in special infiltration tactics, especially a member of the Nazi Sturmabteilung\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, Ian Drury, \u0027German Stormtrooper 1914-18\u0027, Osprey Publishing, page 4\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Indeed, the infantry battle on the desolate ridgeline above Darwin would probably have seemed remarkably familiar to a World War I \u0027\u0027stormtrooper\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027, Mark McNeilly, \u0027Sun Tzu and the Art of Business\u0027, Oxford, page 134\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"As you\u0027ll recall, the idea of the \u0027\u0027stormtrooper\u0027\u0027 arose from the effort to break out of the trench warfare of World War I\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, J.S. Medaware and David Pyke, \u0027Hitler\u0027s Gift\u0027, Arcade Publishing, page 72\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"When he came upon such a scene he went up to a \u0027\u0027stormtrooper\u0027\u0027 to protest\", \"priority\":7}]}, \"synonyms\":{}}");

	add("stormwater", "{\"term\":\"stormwater\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|storm|water|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Water that is not absorbed into soil and rapidly flows downstream, increasing the level of waterways\", \"priority\":1}]}, \"synonyms\":{}}");

	add("storybook", "{\"term\":\"storybook\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|story|book|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A book containing stories, especially children\u0027s stories\", \"priority\":1}]}, \"synonyms\":{}}");

	add("storyland", "{\"term\":\"storyland\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|story|land|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The fictitious world where stories are set\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Allyson James, \u0027Stormwalker\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Thanks also go to my husband for his tireless support—for reading early drafts, brainstorming, and proofreading, and for making sure we have food, clean dishes, and, most important, cat food whenever I\u0027m lost in \u0027\u0027storyland\", \"priority\":3}]}, \"synonyms\":{}}");

	add("storyteller", "{\"term\":\"storyteller\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|story|teller|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who relates stories through one medium or another to an audience\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A game master, particularly in games focused on collaborative storytelling\", \"priority\":2}]}, \"synonyms\":{}}");

	add("storytelling", "{\"term\":\"storytelling\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|story|telling|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act and skills of presenting stories and tales\", \"priority\":1}]}, \"synonyms\":{}}");

	add("stotinka", "{\"term\":\"stotinka\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Bulgarian стотинка ‘hundredth’.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a unit of currency in Bulgaria, equal to one-hundredth of a levCategory:en:Currency\", \"priority\":1}]}, \"synonyms\":{}}");

