	add("stoup", "{\"term\":\"stoup\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old norse\"], \"text\":\"From Old norse \u0027staup\u0027 from Proto-germanic {{m|gem-pro|*staupo-}} ( \u0026gt; Old English {{m|ang|stēap}}). See \u0027\u0027 a vessel. More at sto. Etymology_2|stop.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A bucket\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A mug or drinking vessel\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1602\u0027\u0027, Hamlet\u0027, act V scene 2\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Set me the \u0027\u0027stoups\u0027\u0027 of wine upon that table\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A receptacle for holy water, especially a basin set at the entrance of a church\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1936\u0027\u0027, \u0027Nightwood\u0027, Faber \u0026amp; Faber 2007, p. 26\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"He was seen [...] bathing in the holy water \u0027\u0027stoup\u0027\u0027 as if he were its single and beholden bird, pushing aside weary French maids and local tradespeople with the impatience of a soul in physical distress\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1980\u0027\u0027, \u0027Earthly Powers\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"But, though I liked Morgan well enough, I did not greatly care for his smell, which, incredibly, considering his agnosticism, was not unlike that of stale water in a church \u0027\u0027stoup\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1982\u0027\u0027, \u0027Constance\u0027, Faber \u0026amp; Faber 2004 (\u0027Avignon Quintet\u0027), p. 810\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"She saw nobody for the moment so that she entered the church formally dipping her fingers in the holy water \u0027\u0027stoup\u0027\u0027 and signing herself\", \"priority\":11}]}, \"synonyms\":{}}");

